import React from "react";
import Estilo from "../Hojas de Estilos/ItemMenu.css";
function ItemMenu({ link, setActivo, setNavegacion}){
    return(
        <a className={link.Activo? "item-menu activo" : "item-menu" } onClick={()=>{setActivo()}} href={link.Nombre}>
            {link.Nombre}
        </a>
    );
}
export default ItemMenu;
